import React, { useState } from "react";
import './App.css';

const List = ({text}) => {

  const listArr = ['One', 'Two', 'Three', 'Four', 'Five'];

  const alertClick = (props) => {
    alert(props.value);
  }

  const listItems = listArr.map((listArr, key) =>
    <li key={key}>{text}<button onClick={alertClick}>ALERT</button> </li>
  );


  return (
    <div className="list-container">
      <ul>{listItems}</ul>
    </div>
  );

}

export default List;
